  //   url => fetch(url).then(response => response.json)
  // );

  if (!matchHistory) {
    return <p>loading</p>;
  }

  // console.log(matchHistory);

  return (
    <>
      <ul>
        {matchHistory.matches.map(match => {
          return <li key={match.timestamp}>{match.gameId}</li>;
        })}
      </ul>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/page2">
        <a>Page2</a>
      </Link>
    </>
  );
};

export default SummonerPage;
